import React from "react";
import Hero from "./Hero";
import DreamTeam from "./DreamTeam";
import FarGalaxy from "./FarGalaxy";

interface MainProps {
  page: string;
}

const Main: React.FC<MainProps> = ({ page }) => {
  let selectedComponent;

  switch (page) {
    case "Home":
      selectedComponent = (
        <div>
          <Hero />
          <FarGalaxy />
          <DreamTeam />
        </div>
      );
      break;
    case "About me":
      selectedComponent = ""
      // <AboutMe />;
      break;
    case "Star Wars":
      selectedComponent = <FarGalaxy />;
      break;
    // Add more cases as needed

    default:
      selectedComponent = null;
  }

  return <div className="clearfix">{selectedComponent}</div>;
};

export default Main;
